import React from 'react'
import {Menu,Container} from 'semantic-ui-react'
import {Link} from "react-router-dom";

function NavBar() {
    return (
        <Menu inverted>
            <Container>
               <Menu.Item name="star wars API"/> 
               <Menu.Item name="People"/> 
               <Menu.Item name="Planets"/> 
            </Container>            
        </Menu>
    )
}

export default NavBar
